import React, { Component } from "react";

import Skills from "../about/skills";

class About extends Component {
  componentDidMount() {
    console.log("About Loaded");
  }
  render() {
    return (
      <div className="about">
        <div className="about__me">
          <h1>About Me</h1>
          <h2>Who Am I?</h2>
          <p>
            Unless you've directly landed here skipping the homepage then my
            name is Aman Kumar (Pronounced "Aa-mun Koo-maar"). I am a Front End
            Web Developer from India. I spent 12 hours a day in front of my
            computer, 8 hours for coding, 2 hours browsing reddit.
          </p>
        </div>
        <Skills />
      </div>
    );
  }
}

export default About;
